    <script>
        function CancelReserve(Id) {
            if (confirm(""آیا رزرو لغو شود؟"")) {
                var Id = Id;
                data = { 'Id': Id };

                $.ajax({
                    contentType: 'application/x-www-form-urlencoded',
                    dataType: 'json',
                    type: ""POST"",
                    url: 'CancelReserve',
                    data: data,
                    success: function (data) {
                        if (data.isSuccess == true) {
                            alert(data.message);
                        }
                        else {
                            alert(data.message);
                        }
                    },
                    error: function (request, status, error) {
                        alert(status);
                        alert(""Error"");
                    }
                });
            }
            else {
                alert(""تایید نشد"");
            }
        }//end cancel
    </script>
");
